const filterCode = "";

/*
 * Test scenario:
 * Produced 100,000 words from words.txt to a topic called "consumer-test"
 * Below, we open a consumer stream with a SmartStream filter, using the
 * base64 text above as the WASM binary.
 * Measure the time to consume all elements in the stream. We loop until
 * we hit the word "sacerdotage", which we know is the last word.
 */

export const test = async (fluvio, offset) => {
  const start = new Date();
  const consumer = await fluvio.partitionConsumer("consumer-test", 0);

  let config = {
    smartstreamType: "filter",
    smartstream: filterCode,
  };

  let stream = await consumer.streamWithConfig(offset, config);
  console.log("CREATED STREAM");

  let count = 0;
  while (true) {
    let next = await stream.next();
    let value = next.valueString();

    if (value === "sacerdotage") {
      break;
    }
    count++;
  }
  const end = new Date();

  console.log("Stream ended! Count is ", count);
  console.log("Start time: ", start, ", end time: ", end, ", time diff (ms): ", end - start);
}
